// import logo from './logo.svg';
import './App.css';
import { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        { name: 'Frankestein', id: '1' },
        { name: 'Dracula', id: '2' },
        { name: 'Zombie', id: '3' },
      ]
    }


  }
  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(res => console.log(res))
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map(monter => <h1 key={monter.id} >{monter.name}</h1>)
        }
      </div>
    )
  };
}

export default App;
